--
-- Triggers `did`
--
DELIMITER $$
CREATE TRIGGER `price_update` BEFORE UPDATE ON `did` FOR EACH ROW BEGIN
    IF (NEW.per_minute_price <> OLD.per_minute_price) THEN
        SET NEW.price_modified_date = current_timestamp();
    END IF;
    
	IF (NEW.tier <> OLD.tier) THEN
        SET NEW.price_modified_date = current_timestamp();
    END IF;
    
    IF (NEW.cost <> OLD.cost) THEN
        SET NEW.price_modified_date = current_timestamp();
    END IF;
    
    IF (NEW.company_id <> OLD.company_id) THEN
        SET NEW.price_modified_date = current_timestamp();
    END IF;
    
    IF (NEW.did_active <> OLD.did_active) THEN
        SET NEW.price_modified_date = current_timestamp();
    END IF;
    
    END
$$
DELIMITER ;

