-- Structure for view `company_account_manager`
--
DROP TABLE IF EXISTS `company_account_manager`;

CREATE ALGORITHM=UNDEFINED DEFINER=`yteldb`@`10.98.%` SQL SECURITY DEFINER VIEW `company_account_manager`  AS  (select `companies`.`company_id` AS `company_id`,`companies`.`company_name` AS `company_name`,`users`.`name` AS `name` from (`companies` join `users` on((`companies`.`account_manager` = `users`.`user_id`)))) ;

