--
-- Structure for view `error_solution_views`
--
DROP TABLE IF EXISTS `error_solution_views`;

CREATE ALGORITHM=TEMPTABLE DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `error_solution_views`  AS  select `es`.`error_solution_id` AS `error_solution_id`,concat('ER-',`pt`.`error_code`,'-',`es`.`error_group`,'-',`es`.`code`) AS `error_code`,`es`.`error_message` AS `error_message`,`es`.`solution` AS `solution`,`es`.`notify_users` AS `notify_users` from (`error_solutions` `es` join `product_types` `pt` on((`es`.`product_type_id` = `pt`.`product_type_id`))) where ((`es`.`code` is not null) and (`es`.`active` = 1)) order by concat('ER-',`pt`.`error_code`,'-',`es`.`error_group`,'-',`es`.`code`) ;

